import './App.scss';
import WeitherCard from './components/weitherCard';
import mock from '../src/services/mock'


function App() {
  let weather = new Array();
  let weatherOsasco = new Array();
  let weatherSaoPaulo = new Array();
  weatherOsasco.push(...mock[0].weather)
  weatherSaoPaulo.push(mock[1])
  weatherOsasco.map((data) => weatherOsasco = data.weather)
  console.log('WeatherOsasco: ', weatherOsasco)
  weatherSaoPaulo.map((data) => weatherSaoPaulo = data.weather)
  console.log('WeatherSaoPaulo: ', weatherSaoPaulo)
  mock.map((data) => weather.push(...data.weather))
  //console.log('Mock0: ', mock[0])
  //console.log('Mock1: ', mock[1])

  //console.log('Array de Climas: ', weather)

  return (
    <div className="App">
      {weather.map((data, key) => <WeitherCard 
        key={key} 
        date={data.date} 
        text={data.text} 
        tempMax={data.temperature.max} 
        tempMin={data.temperature.min}
        precipitation={data.rain.precipitation}
        probability={data.rain.probability}
      />)}
    </div>
  );
}

export default App;
